import api from 'src/utils/axios_api'

const Guard = () => {

    const authUser = async () => {
        try {
            const data = await api.post('/refresh')

            if (data.status == 201) { // 엑세스만 재발행
            }

        } catch (error) {
        }
        return false;
    }

    authUser();


};


export default Guard;
